import React from 'react';




function Chracterstics({info}) {
	var pokemoninfo = {}
    info.forEach((pokemon)=>{
    	pokemoninfo[pokemon.id] = pokemon;
    })
    console.log(pokemoninfo)
	return 1;
}
















export default Chracterstics;
